    false,nt"url": null,nt"notes": "<p>NNDSS - Table II. Varicella to West
    Nile virus disease - 2014.<br />nIn this Table, all conditions with a 5-year average
    annual national total of more than or equals 1,000 cases but less than or equals
    10,000 cases will be displayed (u2265 1,000 and u2264 10,000). The Table includes
    total number of cases reported in the United States, by region and by states, in
    accordance with the current method of displaying MMWR data.  Data on United States
    exclude counts from US territories.</p>n<p>Note:<br />nThese are provisional cases
    of selected national notifiable diseases, from the National Notifiable Diseases
    Surveillance System (NNDSS). NNDSS data reported by the 50 states, New York City,
    the District of Columbia, and the U.S. territories are collated and published weekly
    as numbered tables printed in the back of the Morbidity and Mortality Weekly Report
    (MMWR). Cases reported by state health departments to CDC for weekly publication
    are provisional because of ongoing revision of information and delayed reporting.</p>n<p>Case
    counts in this table are presented as they were published in the MMWR issues. Therefore,
    numbers listed in later MMWR weeks may reflect changes made to these counts as additional
    information becomes available.</p>n<p>Footnotes:<br />nC.N.M.I.: Commonwealth of
    Northern Mariana Islands.<br />nU: Unavailable.    -: No reported cases.    N: Not
    reportable.    NN: Not Nationally Notifiable    Cum: Cumulative year-to-date counts.
       Med: Median.    Max: Maximum.<br />n* Case counts for reporting years 2013 and
    2014 are provisional and subject to change. For further information on interpretation
    of these data, see <a href="http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesSurveillanceData20100927.pdf">http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesS...</a>.
    Data for TB are displayed in Table IV, which appears quarterly.<br />nu2020 Updated
    weekly from reports to the Division of Vector-Borne Infectious Diseases, National
    Center for Zoonotic, Vector-Borne, and Enteric Diseases (ArboNet Surveillance).
    Data for California serogroup, eastern equine, Powassan, St. Louis, and western
    equine diseases are available in Table I.<br />nu00a7 Not reportable in all states.
    Data from states where the condition is not reportable are excluded from this table,
    except starting in 2007 for the Arboviral diseases and influenza-associated pediatric
    mortality, and in 2003 for SARS-CoV. Reporting exceptions are available at <a href="http://wwwn.cdc.gov/nndss/document/SRCA_FINAL_REPORT_2006-2012_final.xlsx">http://wwwn.cdc.gov/nndss/document/SRCA_FINAL_REPORT_2006-2012_final.xlsx</a>.</p>n<p>More
    information on NNDSS is available at <a href="http://wwwn.cdc.gov/nndss/">http://wwwn.cdc.gov/nndss/</a>.</p>n",nt"license_title":
